.form-control {color: #495057 !important; font-weight: 500; }
.voyager input[type="file"] {padding: 0px !important; }
.input-group-append, .input-group-prepend {display: flex;}
.input-group {
	position: relative;
	display: flex;
	flex-wrap: wrap;
	align-items: stretch;
	width: 100%;
}
.input-group-text {
	display: flex;
	align-items: center;
	padding: .375rem .75rem;
	margin-bottom: 0;
	font-size: 1rem;
	font-weight: 400;
	line-height: 1.5;
	color: #495057;
	text-align: center;
	white-space: nowrap;
	background-color: #e9ecef;
	border: 1px solid #ced4da;
	border-radius: .25rem;
}
.input-group > .input-group-append:last-child > .btn:not(:last-child):not(.dropdown-toggle), .input-group > .input-group-append:last-child > .input-group-text:not(:last-child), .input-group > .input-group-append:not(:last-child) > .btn, .input-group > .input-group-append:not(:last-child) > .input-group-text, .input-group > .input-group-prepend > .btn, .input-group > .input-group-prepend > .input-group-text {
	border-top-right-radius: 0;
	border-bottom-right-radius: 0;
}
.status, .view, .assignDeliverMan, .buttonML {
    margin-left: 5px;
    cursor: pointer;
}
.customtoggle .switch {
	position: absolute;
	display: inline-block;
	width: 61px;
	height: 32px;
}
.customtoggle .form-group label {
	font-size: 10px;
	margin-bottom: 1px;
}
.customtoggle .toggle_bx .switch {
	width: 70px;
	position: relative;
}
.switch input {
	display: none;
}
.slider {
	cursor: pointer;
}
.slider {
	position: absolute;
	cursor: pointer;
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;
	background-color: #ca2222;
	-webkit-transition: .4s;
	transition: .4s;
	border-radius: 34px;
}
.customtoggle .toggle_bx .switch .slider {
	margin-left: 0;
}
.slider::before {
	position: absolute;
	content: "";
	height: 26px;
	width: 26px;
	left: 5px;
	bottom: 4px;
	background-color: white;
	-webkit-transition: .4s;
	transition: .4s;
	border-radius: 50%;
}
.customtoggle .slider::before {
	height: 29px;
	width: 29px;
	left: 1px;
	bottom: 2px;
}
.slider::after {
	content: 'NO';
	color: white;
	display: block;
	position: absolute;
	transform: translate(-50%,-50%);
	top: 50%;
	left: 50%;
	font-size: 10px;
	font-family: Verdana, sans-serif;
}
.customtoggle .slider::after {
	top: 50%;
	left: 61%;
	font-size: 9px;
	font-weight: bold;
}
input:checked + .slider {
	background-color: #2ab934;
}
input:checked + .slider::before {
	-webkit-transform: translateX(26px);
	-ms-transform: translateX(26px);
	transform: translateX(55px);
}
input:checked + .extratoggle.slider::before {
	left: -15px;
}
input:checked + .slider::after {
	content: 'YES';
}
input:checked + .extratoggle.slider::after {
	left: 35%;
}

